import React from 'react'
import Unit from './Unit'

const UnitsList = (props) => {
  return (
    <ul>
      {props.units.map((unit) => (
        <Unit 
        key={unit.id}
        name={unit.name}
        age={unit.age}
        costs={unit.costs}
        />
      ))}
      </ul>
  );
};

export default UnitsList;
